import React from 'react';
import './index.css';
import logo from '../public/BachKhoaLogo.png'

function Spss(){
    return (
        <div className='NavigationBar'>
            <img src={logo} alt = "logo"></img>
            <h1>HCMUT SPSS</h1>
        </div>
    );
}

export default Spss;
